import React, { useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Navbar from './Navbar';
import useHttpGet from '../hooks/httpGet';
import useGetUserStocks from '../hooks/getUserStocks';

function Dashboard(props) {
//define the states
  //const [stocks] = useHttpGet('http://localhost:5000/api/stocks',[]);
  //const [users] = useHttpGet('http://localhost:5000/api/users', []);
  const [userStock] = useGetUserStocks('http://localhost:5000/api/stocks/', 'Landon5', []);
  const [user] = useState()
  console.log(userStock);
  console.log(props.user);

  return(
    <div>
      <Navbar/>
      <h1>Dashboard</h1>
      <h1>Logged In Status: {props.loggedIn}</h1>
      <h1>User: {props.user.username}</h1>
      <div>
        {/*map through the pokemon and display them on screen a certain way.
        Link is there to allow me to click on a name and bring it to more detail. */}
      {userStock.map(stock => (
        <p key={stock.name}>
          {stock.name}
          
        </p>
      ))}
      
      </div>
    </div>

  );
}

export default Dashboard;
